import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Search from './pages/Search';

const App = () => {
  return (
    <Router>
        <Route exact path="/" component={Search} />
    </Router>
  );
}

export default App;
